	(1,1,24,0,'С ДНЕМ ПОБЕДЫ!!','<p>Поздравляем всех<br />\nс замечательным<br />\nпраздником Победы!</p>',1,100,'#',0,'2013-05-03 19:35:00','2013-05-09 14:53:00',1),
	(2,1,4,0,'НАЗВАНИЕ ПРОЕКТА И СЛОГАН ПРОЕКТА2','<p>краткая информация<br />\nо проекте<br />\nна три или<br />\nчетыре строки</p>',2,100,'#',0,'2013-05-03 19:35:00','2013-05-10 11:46:00',0),
	(3,1,4,0,'НАЗВАНИЕ ПРОЕКТА И СЛОГАН ПРОЕКТА2','<p>краткая информация<br />\nо проекте<br />\nна три или<br />\nчетыре строки</p>',3,100,'#',0,'2013-05-03 19:35:00','2013-05-09 14:43:00',0),
	(4,1,5,0,'НАЗВАНИЕ ПРОЕКТА И СЛОГАН ПРОЕКТА3','<p>краткая информация<br />\nо проекте<br />\nна три или<br />\nчетыре строки</p>',4,100,'#',0,'2013-05-03 19:45:00','2013-05-09 14:43:00',0),
	(5,2,6,0,'Проект','<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>',1,100,'/pr_X_001_001',0,'2013-05-03 21:18:00','2013-05-14 09:40:00',1),
	(6,2,6,0,'НАЗВАНИЕ ПРОЕКТА123','<P>краткая информация о проекте на четыре или шесть строк, в которой изложены основные принципы проекта принципы проекта</P>',1,100,'#',0,'2013-05-03 21:18:00','2013-05-08 14:03:00',0),
	(12,3,0,0,'Проектирование','<p>Проектный отдел компании ОТК готов оказать услуги по составлению технических заданий, проектированию и технико-экономических обоснований любой степени сложности. По запросу заказчика проектный отдел так же готов предоставить разработку проекта &laquo;с нуля&raquo; и полный портфель рабочей документации, а так же провести все этапы согласований проектных решений в инспектирующих органах, обеспечить авторский контроль на объектах.</p>\n\n<p>Наша цель: долгосрочная и качественная работа всех инженерных систем проекта и систем жизнедеятельности.</p>\n\n<p>Все проектные работы осуществляются&nbsp; в строгом соответствии с условиями безопасности, с применением инновационных технологий и материалов, а так же в сопровождении всего комплекса нормативной документации.</p>\n\n<p><strong><em>Проектные работы:</em></strong></p>\n\n<ul>\n	<li>Системы вентиляции и кондиционирования помещений жилой и коммерческой недвижимости;</li>\n	<li>Системы отопления, водоснабжения и канализации;</li>\n	<li>Системы энергоснабжения;</li>\n	<li>Системы освещения (рабочее освещение; аварийное освещение (освещение безопасности и эвакуационное); охранное освещение; дежурное освещение; наружное освещение);</li>\n	<li>Проектирование автоматизации;</li>\n	<li>Системы сигнализации и связи (cлаботочные системы - радиофикация, телефонизация, телевидение; системы безопасности - охранная сигнализация, контроль доступа, оповещение, видеонаблюдение, система передачи данных);</li>\n	<li>Системы противопожарной защиты (устранение причин, которые могут вызвать возникновение пожаров; ограничение распространения возможных пожаров и создание условий для успешной эвакуации людей и имущества в случае пожара; обеспечение своевременного обнаружения возникшего пожара, быстрого вызова пожарной охраны и успешного тушения пожара)</li>\n	<li>Реконструкции уже существующих инженерных систем, повышение эффективности их работы;</li>\n	<li>Архитектурные решения фасадных и внутренних планировок, план с системами наружных конструкций (водопровод, канализация, очистные сооружения, водопроводные и электростанции, тепло-газо-электроснабжение).&nbsp;</li>\n</ul>',2,100,'Projecting',0,'2013-05-03 22:08:00','2013-05-09 12:24:00',1),
