VALUES
	(1,1,'по проектированию','Проектный отдел компании ОТК готов оказать услуги по составлению технических заданий, проектированию и технико-экономических обоснований любой степени сложности. По запросу заказчика проектный отдел так же готов предоставить разработку проекта «с нуля» и полный портфель рабочей документации, а так же провести все этапы согласований проектных решений в инспектирующих органах, обеспечить авторский контроль на объектах.','<p>Проектный отдел компании ОТК готов оказать услуги по составлению технических заданий, проектированию и технико-экономических обоснований любой степени сложности. По запросу заказчика проектный отдел так же готов предоставить разработку проекта &laquo;с нуля&raquo; и полный портфель рабочей документации, а так же провести все этапы согласований проектных решений в инспектирующих органах, обеспечить авторский контроль на объектах.</p>\n\n<p>Наша цель: долгосрочная и качественная работа всех инженерных систем проекта и систем жизнедеятельности.</p>\n\n<p>Все проектные работы осуществляются&nbsp; в строгом соответствии с условиями безопасности, с применением инновационных технологий и материалов, а так же в сопровождении всего комплекса нормативной документации.</p>\n\n<p><strong><em>Проектные работы:</em></strong></p>\n\n<ul>\n	<li>Системы вентиляции и кондиционирования помещений жилой и коммерческой недвижимости;</li>\n	<li>Системы отопления, водоснабжения и канализации;</li>\n	<li>Системы энергоснабжения;</li>\n	<li>Системы освещения (рабочее освещение; аварийное освещение (освещение безопасности и эвакуационное); охранное освещение; дежурное освещение; наружное освещение);</li>\n	<li>Проектирование автоматизации;</li>\n	<li>Системы сигнализации и связи (cлаботочные системы - радиофикация, телефонизация, телевидение; системы безопасности - охранная сигнализация, контроль доступа, оповещение, видеонаблюдение, система передачи данных);</li>\n	<li>Системы противопожарной защиты (устранение причин, которые могут вызвать возникновение пожаров; ограничение распространения возможных пожаров и создание условий для успешной эвакуации людей и имущества в случае пожара; обеспечение своевременного обнаружения возникшего пожара, быстрого вызова пожарной охраны и успешного тушения пожара)</li>\n	<li>Реконструкции уже существующих инженерных систем, повышение эффективности их работы;</li>\n</ul>\n\n<p>&nbsp;</p>','2013-05-04 12:05:00','2013-05-04 10:38:00',0,0,'left','2013-05-04 10:37:00',0,''),
	(2,1,'по модернизации','Места прохода людей в пределах опасных зон должны иметь защитные ограждения. Входы в строящиеся здания (сооружения) должны быть защищены сверху козырьком шириной не менее 2 м от стены здания. Угол, образуемый между козырьком и вышерасположенной стеной над входом, должен быть 70 - 75°.','<p>Места прохода людей в пределах опасных зон должны иметь защитные ограждения. Входы в строящиеся здания (сооружения) должны быть защищены сверху козырьком шириной не менее 2 м от стены здания. Угол, образуемый между козырьком и вышерасположенной стеной над входом, должен быть 70 - 75°.</p><p>Места прохода людей в пределах опасных зон должны иметь защитные ограждения. Входы в строящиеся здания (сооружения) должны быть защищены сверху козырьком шириной не менее 2 м от стены здания. Угол, образуемый между козырьком и вышерасположенной стеной над входом, должен быть 70 - 75°.</p><p>Места прохода людей в пределах опасных зон должны иметь защитные ограждения. Входы в строящиеся здания (сооружения) должны быть защищены сверху козырьком шириной не менее 2 м от стены здания. Угол, образуемый между козырьком и вышерасположенной стеной над входом, должен быть 70 - 75°.</p><p>Места прохода людей в пределах опасных зон должны иметь защитные ограждения. Входы в строящиеся здания (сооружения) должны быть защищены сверху козырьком шириной не менее 2 м от стены здания. Угол, образуемый между козырьком и вышерасположенной стеной над входом, должен быть 70 - 75°.</p>','2013-05-04 10:38:00','2013-05-04 10:38:00',0,0,'left','2013-05-04 10:37:00',0,''),
