	(5,2,'Название проекта 4','В данном маленьком абзаце необходимо разместить текст-завлечение для пользователей, интересующихся данным видом проектов или самим проектом. Количество строк предположительно 3-4.','<p style=\"color: rgb(0, 0, 0); font-family: verdana; line-height: normal; text-align: justify;\"><span style=\"color: rgb(0, 0, 0); font-family: verdana; line-height: normal; text-align: justify;\">Текстовый блок с описанием проекта</span></p>','2013-05-11 11:55:00','2013-05-05 00:36:00',0,0,'left','2013-05-04 00:00:00',0,'pr_X_001_001'),
	(9,2,'Название проекта 3','В данном маленьком абзаце необходимо разместить текст-завлечение для пользователей, интересующихся данным видом проектов или самим проектом. Количество строк предположительно 3-4.','<p style=\"color: rgb(0, 0, 0); font-family: verdana; line-height: normal; text-align: justify;\"><span style=\"color: rgb(0, 0, 0); font-family: verdana; line-height: normal; text-align: justify;\">Текстовый блок с описанием проекта</span></p>','2013-05-11 11:55:00','2013-05-05 00:55:00',0,0,'left','2013-05-05 00:48:00',0,'pr_X_001_002'),
	(10,2,'Название проекта 2','В данном маленьком абзаце необходимо разместить текст-завлечение для пользователей, интересующихся данным видом проектов или самим проектом. Количество строк предположительно 3-4.','<p style=\"color: rgb(0, 0, 0); font-family: verdana; line-height: normal; text-align: justify;\"><span style=\"color: rgb(0, 0, 0); font-family: verdana; line-height: normal; text-align: justify;\">Текстовый блок с описанием проекта</span></p>','2013-05-11 11:55:00','2013-05-05 00:55:00',0,0,'left','2013-05-05 00:55:00',0,'pr_X_001_003'),
	(11,2,'Название проекта 1','В данном маленьком абзаце необходимо разместить текст-завлечение для пользователей, интересующихся данным видом проектов или самим проектом. Количество строк предположительно 3-4.','<p style=\"color: rgb(0, 0, 0); font-family: verdana; line-height: normal; text-align: justify;\">Текстовый блок с описанием проекта</p>','2013-05-11 11:54:00','2013-05-05 00:56:00',0,1,'left','2013-05-25 00:56:00',1,'pr_X_001_001'),
	(18,4,'Новость','В данном маленьком абзаце необходимо разместить текст-завлечение дял пользователей, интересующихся данным видом проектов или самим проектом. Количество строк предположительно 3-4.','<p style=\"color: rgb(0, 0, 0); font-family: verdana; line-height: normal; text-align: justify;\">5.11.1 Руководящие работники и специалисты организаций по списку должностей, утвержденному руководителем организации, обязаны перед допуском к работе, а в дальнейшем периодически в установленные сроки проходить проверку знания ими правил охраны и безопасности труда с учетом их должностных обязанностей и характера выполнения работ. Порядок проведения обучения и проверки знаний определяется согласно СП 12-131.</p>\n\n<p style=\"color: rgb(0, 0, 0); font-family: verdana; line-height: normal; text-align: justify;\">5.11.2 Работники, ранее не обученные безопасным методам труда по профессиям, указанным при приеме на работу, в течение месяца со дня зачисления на работу должны быть обучены согласно ГОСТ 12.0.004 в объеме инструкций по охране труда для соответствующих профессий, составленных на основе Типовых отраслевых инструкций по охране труда ТОИ Р 66.</p>\n\n<p style=\"color: rgb(0, 0, 0); font-family: verdana; line-height: normal; text-align: justify;\">После окончания обучения, а в дальнейшем ежегодно и при переходе из одной организации в другую или при нарушениях, выявленных ответственными лицами или органами надзора, следует проводить проверку знания инструкций по охране труда, утвержденных руководителем организации, в которую зачислены указанные работники. Проверка знаний должна проводиться комиссией, назначенной приказом работодателя. Результаты проверки следует оформлять записью в журнале и в удостоверении установленной формы.</p>\n\n<p style=\"color: rgb(0, 0, 0); font-family: verdana; line-height: normal; text-align: justify;\">Повторный инструктаж по безопасности труда следует проводить для всех работников не реже одного раза в три месяца. При выполнении работ на территории другой организации инструктаж следует проводить с привлечением ответственных лиц по охране труда этой организации.</p>\n\n<p style=\"color: rgb(0, 0, 0); font-family: verdana; line-height: normal; text-align: justify;\">5.11.4 В организации должны быть созданы условия для изучения работниками правил и инструкций по охране труда, требования которых распространяются на данный вид производственной деятельности. Комплект указанных документов, определяемый Госстроем России [9, 10], должен быть в каждом производственном подразделении организации и предоставляться работникам для самоподготовки.</p>\n\n<p style=\"color: rgb(0, 0, 0); font-family: verdana; line-height: normal; text-align: justify;\">5.12 Персонал организации (лица), производящей обслуживание машин, оборудования, установок и работы, подконтрольной органам государственного надзора России, допускается к работе в соответствии с требованиями этих органов.</p>\n\n<p style=\"color: rgb(0, 0, 0); font-family: verdana; line-height: normal; text-align: justify;\">5.13 При работе учащихся среднего, начального профессионального образования и образовательных учреждений основного общего образования, а также студентов вузов во время прохождения ими производственной практики или проведения работ по договору руководитель организации обязан:</p>\n\n<p style=\"color: rgb(0, 0, 0); font-family: verdana; line-height: normal; text-align: justify;\">обучить указанные лица до их направления на рабочие места безопасным методам и приемам труда по типовым программам для работников, указанных в приказе о зачислении на работу, и обеспечить инструктаж по безопасности труда согласно действующим правилам;</p>\n\n<p style=\"color: rgb(0, 0, 0); font-family: verdana; line-height: normal; text-align: justify;\">обеспечить санитарно-бытовое обслуживание указанных лиц и выдачу им бесплатной спецодежды, спецобуви и других средств индивидуальной защиты не ниже установленных норм;</p>','2013-05-05 01:20:00','2013-05-05 01:18:00',0,0,'left','2013-05-05 00:00:00',0,''),
	(19,4,'Новость 2','В данном маленьком абзаце необходимо разместить текст-завлечение дял пользователей, интересующихся данным видом проектов или самим проектом. Количество строк предположительно 3-4.','<p style=\"color: rgb(0, 0, 0); font-family: verdana; line-height: normal; text-align: justify;\">5.11.1 Руководящие работники и специалисты организаций по списку должностей, утвержденному руководителем организации, обязаны перед допуском к работе, а в дальнейшем периодически в установленные сроки проходить проверку знания ими правил охраны и безопасности труда с учетом их должностных обязанностей и характера выполнения работ. Порядок проведения обучения и проверки знаний определяется согласно СП 12-131.</p>\n\n<p style=\"color: rgb(0, 0, 0); font-family: verdana; line-height: normal; text-align: justify;\">5.11.2 Работники, ранее не обученные безопасным методам труда по профессиям, указанным при приеме на работу, в течение месяца со дня зачисления на работу должны быть обучены согласно ГОСТ 12.0.004 в объеме инструкций по охране труда для соответствующих профессий, составленных на основе Типовых отраслевых инструкций по охране труда ТОИ Р 66.</p>\n\n<p style=\"color: rgb(0, 0, 0); font-family: verdana; line-height: normal; text-align: justify;\">После окончания обучения, а в дальнейшем ежегодно и при переходе из одной организации в другую или при нарушениях, выявленных ответственными лицами или органами надзора, следует проводить проверку знания инструкций по охране труда, утвержденных руководителем организации, в которую зачислены указанные работники. Проверка знаний должна проводиться комиссией, назначенной приказом работодателя. Результаты проверки следует оформлять записью в журнале и в удостоверении установленной формы.</p>\n\n<p style=\"color: rgb(0, 0, 0); font-family: verdana; line-height: normal; text-align: justify;\">Повторный инструктаж по безопасности труда следует проводить для всех работников не реже одного раза в три месяца. При выполнении работ на территории другой организации инструктаж следует проводить с привлечением ответственных лиц по охране труда этой организации.</p>\n\n<p style=\"color: rgb(0, 0, 0); font-family: verdana; line-height: normal; text-align: justify;\">5.11.4 В организации должны быть созданы условия для изучения работниками правил и инструкций по охране труда, требования которых распространяются на данный вид производственной деятельности. Комплект указанных документов, определяемый Госстроем России [9, 10], должен быть в каждом производственном подразделении организации и предоставляться работникам для самоподготовки.</p>\n\n<p style=\"color: rgb(0, 0, 0); font-family: verdana; line-height: normal; text-align: justify;\">5.12 Персонал организации (лица), производящей обслуживание машин, оборудования, установок и работы, подконтрольной органам государственного надзора России, допускается к работе в соответствии с требованиями этих органов.</p>\n\n<p style=\"color: rgb(0, 0, 0); font-family: verdana; line-height: normal; text-align: justify;\">5.13 При работе учащихся среднего, начального профессионального образования и образовательных учреждений основного общего образования, а также студентов вузов во время прохождения ими производственной практики или проведения работ по договору руководитель организации обязан:</p>\n\n<p style=\"color: rgb(0, 0, 0); font-family: verdana; line-height: normal; text-align: justify;\">обучить указанные лица до их направления на рабочие места безопасным методам и приемам труда по типовым программам для работников, указанных в приказе о зачислении на работу, и обеспечить инструктаж по безопасности труда согласно действующим правилам;</p>\n\n<p style=\"color: rgb(0, 0, 0); font-family: verdana; line-height: normal; text-align: justify;\">обеспечить санитарно-бытовое обслуживание указанных лиц и выдачу им бесплатной спецодежды, спецобуви и других средств индивидуальной защиты не ниже установленных норм;</p>','2013-05-05 01:20:00','2013-05-05 01:18:00',0,0,'left','2013-05-05 00:00:00',0,''),
	(20,4,'Новость 3','В данном маленьком абзаце необходимо разместить текст-завлечение дял пользователей, интересующихся данным видом проектов или самим проектом. Количество строк предположительно 3-4.','<p style=\"color: rgb(0, 0, 0); font-family: verdana; line-height: normal; text-align: justify;\">5.11.1 Руководящие работники и специалисты организаций по списку должностей, утвержденному руководителем организации, обязаны перед допуском к работе, а в дальнейшем периодически в установленные сроки проходить проверку знания ими правил охраны и безопасности труда с учетом их должностных обязанностей и характера выполнения работ. Порядок проведения обучения и проверки знаний определяется согласно СП 12-131.</p>\n\n<p style=\"color: rgb(0, 0, 0); font-family: verdana; line-height: normal; text-align: justify;\">5.11.2 Работники, ранее не обученные безопасным методам труда по профессиям, указанным при приеме на работу, в течение месяца со дня зачисления на работу должны быть обучены согласно ГОСТ 12.0.004 в объеме инструкций по охране труда для соответствующих профессий, составленных на основе Типовых отраслевых инструкций по охране труда ТОИ Р 66.</p>\n\n<p style=\"color: rgb(0, 0, 0); font-family: verdana; line-height: normal; text-align: justify;\">После окончания обучения, а в дальнейшем ежегодно и при переходе из одной организации в другую или при нарушениях, выявленных ответственными лицами или органами надзора, следует проводить проверку знания инструкций по охране труда, утвержденных руководителем организации, в которую зачислены указанные работники. Проверка знаний должна проводиться комиссией, назначенной приказом работодателя. Результаты проверки следует оформлять записью в журнале и в удостоверении установленной формы.</p>\n\n<p style=\"color: rgb(0, 0, 0); font-family: verdana; line-height: normal; text-align: justify;\">Повторный инструктаж по безопасности труда следует проводить для всех работников не реже одного раза в три месяца. При выполнении работ на те