','2013-05-05 00:00:00',0,''),
	(30,6,'Строительный контроль','Общие данные о строительном контроле','<p style=\"color: rgb(0, 0, 0); font-family: verdana; line-height: normal; text-align: justify;\"><span style=\"color: rgb(66, 66, 66); font-family: arial; font-size: 12px; line-height: normal;\">Строительный контроль проводится лицом, осуществляющим строительство.</span><br style=\"color: rgb(66, 66, 66); font-family: arial; font-size: 12px; line-height: normal;\" />\n<span style=\"color: rgb(66, 66, 66); font-family: arial; font-size: 12px; line-height: normal;\">В случае осуществления строительства, реконструкции, капитального ремонта на основании договора строительный контроль проводится также застройщиком или заказчиком либо привлекаемым ими на основании договора физическим или юридическим лицом. Застройщик или заказчик по своей инициативе может привлекать лицо, осуществляющее подготовку проектной документации, для проверки соответствия выполняемых работ проектной документации.</span></p>\n\n<p style=\"color: rgb(0, 0, 0); font-family: verdana; line-height: normal; text-align: justify;\">&nbsp;</p>\n\n<p align=\"center\" style=\"color: rgb(66, 66, 66); font-family: arial; font-size: 12px; line-height: normal;\"><strong>Нормативные документы,<br />\nустанавливающие основные принципы строительного контроля</strong></p>\n\n<ol style=\"color: rgb(66, 66, 66); font-family: arial; font-size: 12px; line-height: normal;\">\n	<li style=\"margin-bottom: 10px;\"><a href=\"http://www.igsn-permkrai.ru/files/zakon_190.doc\" style=\"color: rgb(80, 125, 223);\">Градостроительный кодекс РФ</a>&nbsp;(статья 53, глава 6.1).</li>\n	<li style=\"margin-bottom: 10px;\"><a href=\"http://www.igsn-permkrai.ru/files/postanovlenie_468.doc\" style=\"color: rgb(80, 125, 223);\">Постановление Правительства РФ от 21 июня 2010г. № 468&nbsp;</a>&laquo;О порядке проведения строительного контроля при осуществлении строительства, реконструкции и капитального ремонта объектов капитального строительства&raquo;.</li>\n	<li style=\"margin-bottom: 10px;\"><a href=\"http://www.igsn-permkrai.ru/files/prikaz_1128.doc\" style=\"color: rgb(80, 125, 223);\">Приказ Ростехнадзора от 26 декабря 2006г. № 1128</a>&nbsp;&laquo;Об утверждении и введении в действие Требований к составу и порядку ведения исполнительной документации при строительстве, реконструкции, капитальном ремонте объектов капитального строительства и требований, предъявляемых к актам освидетельствования работ, конструкций, участков сетей инженерно-технического обеспечения&raquo; (РД-11-02-2006).</li>\n	<li style=\"margin-bottom: 10px;\"><a href=\"http://www.igsn-permkrai.ru/files/prikaz_7.doc\" style=\"color: rgb(80, 125, 223);\">Приказ Ростехнадзора от 12 января 2007г. № 7</a>&nbsp;&laquo;Об утверждении и введении в действие Порядка ведения общего и (или) специального журнала учета выполнения работ при строительстве, реконструкции, капитальном ремонте объектов капитального строительства&raquo; (РД-11-05-2007).</li>\n	<li style=\"margin-bottom: 10px;\"><a href=\"http://www.igsn-permkrai.ru/files/snip12_01_2004.doc\" style=\"color: rgb(80, 125, 223);\">СНиП 12-01-2004&nbsp;</a>&laquo;Организация строительства&raquo; раздел 6 (пункты 6.1.1.-6.1.6., 6.2., 6.5.).</li>\n	<li style=\"margin-bottom: 10px;\"><a href=\"http://www.igsn-permkrai.ru/files/prikaz_624.doc\" style=\"color: rgb(80, 125, 223);\">Приказ Минрегиона от 30 декабря 2009г.</a>&nbsp;&laquo;Об утверждении перечня видов работ по инженерным изысканиям, по подготовке проектной документации, по строительству, реконструкции, капитальному ремонту объектов капитального строительства, которые влияют на безопасность объектов капитального строительства&raquo; (в части необходимости свидетельства о допуске, выданного СРО, для осуществления строительного контроля).</li>\n</ol>','2013-05-13 21:52:00','2013-05-09 12:13:00',0,0,'left','2013-05-05 00:00:00',0,''),
	(31,6,'Строительно-монтажные работы','Общие данные о строительно-монтажных работах','<p style=\"color: rgb(0, 0, 0); font-family: verdana; line-height: normal; text-align: justify;\"><strong style=\"color: rgb(64, 47, 21); font-family: arial, sans-serif; line-height: normal;\">СТРОИТЕЛЬНО-МОНТАЖНЫЕ РАБОТЫ</strong><span style=\"color: rgb(0, 0, 0); font-family: arial, sans-serif; line-height: normal;\">&nbsp;&mdash; работы по строительству производственных и непроизводственных объектов и монтажу (установке) в них оборудования. К строительным работам относятся: возведение зданий и сооружений, устройство оснований, фундаментов и опорных конструкций под оборудование, работы по освоению участков, подготовке территории к строительству, по озеленению и благоустройству, сани-тарно-технические и электромонтажные работы.</span><br style=\"color: rgb(0, 0, 0); font-family: arial, sans-serif; line-height: normal;\" />\n<br style=\"color: rgb(0, 0, 0); font-family: arial, sans-serif; line-height: normal;\" />\n<span style=\"color: rgb(0, 0, 0); font-family: arial, sans-serif; line-height: normal;\">Работы по монтажу оборудования включают: сборку и установку технологического, энергетического, подъемно-транспортного и иного оборудования. В 1986&mdash;1990 гг. объем строительно-монтажных работ составит примерно 500 млрд руб.</span><br style=\"color: rgb(0, 0, 0); font-family: arial, sans-serif; line-height: normal;\" />\n<br style=\"color: rgb(0, 0, 0); font-family: arial, sans-serif; line-height: normal;\" />\n<span style=\"color: rgb(0, 0, 0); font-family: arial, sans-serif; line-height: normal;\">В зависимости от форм воспроизводства основных фондов (техническое перевооружение, реконструкция, расширение действующих и строительство новых предприятий) доля строительно-монтажных работ в капитальных вложениях существенно меняется: от 10&mdash;15 % при техническом перевооружении до 40&mdash;50 % при реконструкции и расширении и 50&mdash; 70 % при строительстве новых предприятий. В связи с курсом на ускорение технического перевооружения и реконструкции предприятий доля затрат на строительно-монтажные работы уменьшается.</span><br style=\"color: rgb(0, 0, 0); font-family: arial, sans-serif; line-height: normal;\" />\n<br style=\"color: rgb(0, 0, 0); font-family: arial, sans-serif; line-height: normal;\" />\n<span style=\"color: rgb(0, 0, 0); font-family: arial, sans-serif; line-height: normal;\">Общий объем строительно-монтажных работ &mdash; это объем работ по соответствующим элементам зданий, сооружений, пусковых комплексов, объектов, выполненных за месяц, квартал, год, пятилетку как на пусковых объектах данного периода, так и на объектах, сдаваемых заказчикам в следующем плановом периоде.</span><br style=\"color: rgb(0, 0, 0); font-family: arial, sans-serif; line-height: normal;\" />\n<br style=\"color: rgb(0, 0, 0); font-family: arial, sans-serif; line-height: normal;\" />\n<span style=\"color: rgb(0, 0, 0); font-family: arial, sans-serif; line-height: normal;\">В пятилетних планах в качестве основы для заключения договоров между заказчиками и подрядчиками определяются объемы подрядных строительно-монтажных работ, необходимые для обеспечения строительства и ввода в действие в нормативные сроки мощностей и объектов и планирования мероприятий по развитию мощностей строительно-монтажных организаций.</span><br style=\"color: rgb(0, 0, 0); font-family: arial, sans-serif; line-height: normal;\" />\n<br style=\"color: rgb(0, 0, 0); font-family: arial, sans-serif; line-height: normal;\" />\n<span style=\"color: rgb(0, 0, 0); font-family: arial, sans-serif; line-height: normal;\">В годовых планах утверждаются объемы подрядных работ, подлежащих выполнению в соответствии с договорами подряда на пусковых объектах планируемого года, а также на задельных объектах по технологическим этапам и комплексам работ, намечаемых к вводу в действие в последующие годы (см. также Капитальное строительство).</span></p>','2013-05-13 21:53:00','2013-05-09 12:13:00',0,0,'left','2013-05-05 00:00:00',0,''),
	(32,6,'Охрана окружающей среды','Общая информация о защите окружающей среды.','<p style=\"margin: 0.4em 0px 0.5em; line-height: 19.1875px; color: rgb(0, 0, 0); font-family: sans-serif;\"><b>Охрана&nbsp;<a href=\"http://ru.wikipedia.org/wiki/%D0%9E%D0%BA%D1%80%D1%83%D0%B6%D0%B0%D1%8E%D1%89%D0%B0%D1%8F_%D1%81%D1%80%D0%B5%D0%B4%D0%B0\" style=\"text-decoration: none; color: rgb(11, 0, 128); background-image: none; background-position: initial initial; background-repeat: initial initial;\" title=\"Окружающая среда\">окружающей среды</a></b>, или&nbsp;<b>прикладная экология</b>&nbsp;&mdash; комплекс мер, предназначенных для ограничения отрицательного влияния человеческой деятельности на&nbsp;<a href=\"http://ru.wikipedia.org/wiki/%D0%9F%D1%80%D0%B8%D1%80%D0%BE%D0%B4%D0%B0\" style=\"text-decoration: none; color: rgb(11, 0, 128); background-image: none; background-position: initial initial; background-repeat: initial initial;\" title=\"Природа\">природу</a>. В западных странах часто используется также понятие&nbsp;<b>энвайронментология</b>&nbsp;(<i><a class=\"extiw\" href=\"http://en.wikipedia.org/wiki/Environmental_science\" style=\"text-decoration: none; color: rgb(102, 51, 102); background-image: none; background-position: initial initial; background-repeat: initial initial;\" title=\"en:Environmental science\">en:Environmental science</a></i>), которое в отечественной литературе выражается термином &laquo;наука об охране окружающей среды&raquo;.<sup class=\"reference\" id=\"cite_ref-1\" style=\"line-height: 1em;\"><a href=\"http://ru.wikipedia.org/wiki/%D0%9E%D1%85%D1%80%D0%B0%D0%BD%D0%B0_%D0%BE%D0%BA%D1%80%D1%83%D0%B6%D0%B0%D1%8E%D1%89%D0%B5%D0%B9_%D1%81%D1%80%D0%B5%D0%B4%D1%8B#cite_note-1\" style=\"text-decoration: none; color: rgb(11, 0, 128); background-image: none; background-position: initial initial; background-repeat: initial initial;\">[1]</a></sup></p>\n\n<p style=\"margin: 0.4em 0px 0.5em; line-height: 19.1875px; color: rgb(0, 0, 0); font-family: sans-serif;\">Такими мерами могут являться:</p>\n\n<ul style=\"line-height: 19.1875px; margin: 0.3em 0px 0px 1.6em; padding-right: 0px; padding-left: 0px; list-style-image: url(data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAUAAAANAQMAAABb8jbLAAAABlBMVEX///8AUow5QSOjAAAAAXRSTlMAQObYZgAAABNJREFUCB1jYEABBQw/wLCAgQEAGpIDyT0IVcsAAAAASUVORK5CYII=); color: rgb(0, 0, 0); font-family: sans-serif;\">\n	<li style=\"margin-bottom: 0.1em;\">Ограничение&nbsp;<a href=\"http://ru.wikipedia.org/wiki/%D0%92%D1%8B%D0%B1%D1%80%D0%BE%D1%81%D1%8B\" style=\"text-decoration: none; color: rgb(11, 0, 128); background-image: none; background-position: initial initial; background-repeat: initial initial;\" title=\"Выбросы\">выбросов</a>&nbsp;в&nbsp;<a href=\"http://ru.wikipedia.org/wiki/%D0%90%D1%82%D0%BC%D0%BE%D1%81%D1%84%D0%B5%D1%80%D0%B0_%D0%97%D0%B5%D0%BC%D0%BB%D0%B8\" style=\"text-decoration: none; color: rgb(11, 0, 128); background-image: none; background-position: initial initial; background-repeat: initial initial;\" title=\"Атмосфера Земли\">атмосферу</a>&nbsp;и&nbsp;<a href=\"http://ru.wikipedia.org/wiki/%D0%93%D0%B8%D0%B4%D1%80%D0%BE%D1%81%D1%84%D0%B5%D1%80%D0%B0\" style=\"text-decoration: none; color: rgb(11, 0, 128); background-image: none; background-position: initial initial; background-repeat: initial initial;\" title=\"Гидросфера\">гидросферу</a>&nbsp;с целью улучшения общей&nbsp;<a href=\"http://ru.wikipedia.org/wiki/%D0%AD%D0%BA%D0%BE%D0%BB%D0%BE%D0%B3%D0%B8%D1%8F\" style=\"text-decoration: none; color: rgb(11, 0, 128); background-image: none; background-position: initial initial; background-repeat: initial initial;\" title=\"Экология\">экологической</a>&nbsp;обстановки.</li>\n	<li style=\"margin-bottom: 0.1em;\">Создание&nbsp;<a href=\"http://ru.wikipedia.org/wiki/%D0%97%D0%B0%D0%BF%D0%BE%D0%B2%D0%B5%D0%B4%D0%BD%D0%B8%D0%BA\" style=\"text-decoration: none; color: rgb(11, 0, 128); background-image: none; background-position: initial initial; background-repeat: initial initial;\" title=\"Заповедник\">заповедников</a>,&nbsp;<a href=\"http://ru.wikipedia.org/wiki/%D0%97%D0%B0%D0%BA%D0%B0%D0%B7%D0%BD%D0%B8%D0%BA\" style=\"text-decoration: none; color: rgb(11, 0, 128); background-image: none; background-position: initial initial; background-repeat: initial initial;\" title=\"Заказник\">заказников</a>&nbsp;и&nbsp;<a href=\"http://ru.wikipedia.org/wiki/%D0%9D%D0%B0%D1%86%D0%B8%D0%BE%D0%BD%D0%B0%D0%BB%D1%8C%D0%BD%D1%8B%D0%B9_%D0%BF%D0%B0%D1%80%D0%BA\" style=\"text-decoration: none; color: rgb(11, 0, 128); background-image: none; background-position: initial initial; background-repeat: initial initial;\" title=\"Национальный парк\">национальных парков</a>&nbsp;с целью сохранения природных комплексов.</li>\n	<li style=\"margin-bottom: 0.1em;\">Ограничение лова&nbsp;<a class=\"mw-redirect\" href=\"http://ru.wikipedia.org/wiki/%D0%A0%D1%8B%D0%B1%D0%B0\" style=\"text-decoration: none; color: rgb(11, 0, 128); background-image: none; background-position: initial initial; background-repeat: initial initial;\" title=\"Рыба\">рыбы</a>, охоты с целью сохранения определённых видов.</li>\n	<li style=\"margin-bottom: 0.1em;\">Ограничение несанкционированного выброса мусора. Использование методов экологической логистики для тотальной очистки от несанкционированного мусора территории региона.</li>\n</ul>\n\n<p style=\"margin: 0.4em 0px 0.5em; line-height: 19.1875px; color: rgb(0, 0, 0); font-family: sans-serif;\">На сегодняшний день эта проблема обостряется с каждым днем все сильнее.</p>\n\n<p style=\"margin: 0.4em 0px 0.5em; line-height: 19.1875px; color: rgb(0, 0, 0); font-family: sans-serif;\"><b>Энвайронменталистика</b>&nbsp;&mdash; техническое приложение энвайронментологии &mdash; наука о способах и методах очистки выбросов и сбросов, переработке отходов, технологических приёмах улучшения качества окружающей среды. В русских источниках часто употребляется практически синонимичный термин&nbsp;<i>&laquo;инженерная защита окружающей среды&raquo;</i>.</p>\n\n<p style=\"margin: 0.4em 0px 0.5em; line-height: 19.1875px; color: rgb(0, 0, 0); font-family: sans-serif;\">Энвайронменталистика включает в себя контроль над загрязнением&nbsp;<a href=\"http://ru.wikipedia.org/wiki/%D0%97%D0%B0%D0%B3%D1%80%D1%8F%D0%B7%D0%BD%D0%B5%D0%BD%D0%B8%D0%B5_%D0%BF%D1%80%D0%B5%D1%81%D0%BD%D1%8B%D1%85_%D0%B2%D0%BE%D0%B4\" style=\"text-decoration: none; color: rgb(11, 0, 128); background-image: none; background-position: initial initial; background-repeat: initial initial;\" title=\"Загрязнение пресных вод\">воды</a>&nbsp;и&nbsp;<a class=\"mw-redirect\" href=\"http://ru.wikipedia.org/wiki/%D0%97%D0%B0%D0%B3%D1%80%D1%8F%D0%B7%D0%BD%D0%B5%D0%BD%D0%B8%D0%B5_%D0%B0%D1%82%D0%BC%D0%BE%D1%81%D1%84%D0%B5%D1%80%D1%8B\" style=\"text-decoration: none; color: rgb(11, 0, 128); background-image: none; background-position: initial initial; background-repeat: initial initial;\" title=\"Загрязнение атмосферы\">воздуха</a>,&nbsp;<a href=\"http://ru.wikipedia.org/wiki/%D0%A1%D0%B8%D1%81%D1%82%D0%B5%D0%BC%D0%B0_%D1%83%D0%BF%D1%80%D0%B0%D0%B2%D0%BB%D0%B5%D0%BD%D0%B8%D1%8F_%D0%BE%D1%82%D1%85%D0%BE%D0%B4%D0%B0%D0%BC%D0%B8\" style=\"text-decoration: none; color: rgb(11, 0, 128); background-image: none; background-position: initial initial; background-repeat: initial initial;\" title=\"Система управления отходами\">управление отходами</a>, а также заботу об<a class=\"mw-redirect\" href=\"http://ru.wikipedia.org/wiki/%D0%9E%D0%B1%D1%89%D0%B5%D1%81%D1%82%D0%B2%D0%B5%D0%BD%D0%BD%D0%BE%D0%B5_%D0%B7%D0%B4%D0%BE%D1%80%D0%BE%D0%B2%D1%8C%D0%B5\" style=\"text-decoration: none; color: rgb(11, 0, 128); background-image: none; background-position: initial initial; background-repeat: initial initial;\" title=\"Общественное здоровье\">Общественном здоровье</a>.</p>','2013-05-13 21:55:00','2013-05-09 12:13:00',0,0,'left','2013-05-05 00:00:00',0,''),
	(33,6,'Мониторинг','Статья о мониторинге','<p style=\"margin: 0.4em 0px 0.5em; line-height: 19.1875px; color: rgb(0, 0, 0); font-family: sans-serif;\"><b>Мониторинг</b>&nbsp;&mdash;&nbsp;<a href=\"http://ru.wikipedia.org/wiki/%D0%A1%D0%B8%D1%81%D1%82%D0%B5%D0%BC%D0%B0%D1%82%D0%B8%D0%B7%D0%B0%D1%86%D0%B8%D1%8F\" style=\"text-decoration: none; color: rgb(11, 0, 128); background-image: none; background-position: initial initial; background-repeat: initial initial;\" title=\"Систематизация\">систематический</a>&nbsp;сбор и обработка&nbsp;<a href=\"http://ru.wikipedia.org/wiki/%D0%98%D0%BD%D1%84%D0%BE%D1%80%D0%BC%D0%B0%D1%86%D0%B8%D1%8F\" style=\"text-decoration: none; color: rgb(11, 0, 128); background-image: none; background-position: initial initial; background-repeat: initial initial;\" title=\"Информация\">информации</a>, которая может быть использована для улучшения процесса принятия решения, а также, косвенно, для информирования&nbsp;<a href=\"http://ru.wikipedia.org/wiki/%D0%9E%D0%B1%D1%89%D0%B5%D1%81%D1%82%D0%B2%D0%B5%D0%BD%D0%BD%D0%BE%D1%81%D1%82%D1%8C\" style=\"text-decoration: none; color: rgb(11, 0, 128); background-image: none; background-position: initial initial; background-repeat: initial initial;\" title=\"Общественность\">общественности</a>&nbsp;или прямо как&nbsp;<a href=\"http://ru.wikipedia.org/wiki/%D0%98%D0%BD%D1%81%D1%82%D1%80%D1%83%D0%BC%D0%B5%D0%BD%D1%82\" style=\"text-decoration: none; color: rgb(11, 0, 128); background-image: none; background-position: initial initial; background-repeat: initial initial;\" title=\"Инструмент\">инструмент</a>&nbsp;<a href=\"http://ru.wikipedia.org/wiki/%D0%9E%D0%B1%D1%80%D0%B0%D1%82%D0%BD%D0%B0%D1%8F_%D1%81%D0%B2%D1%8F%D0%B7%D1%8C\" style=\"text-decoration: none; color: rgb(11, 0, 128); background-image: none; background-position: initial initial; background-repeat: initial initial;\" title=\"Обратная связь\">обратной связи</a>&nbsp;в целях осуществления&nbsp;<a href=\"http://ru.wikipedia.org/wiki/%D0%9F%D1%80%D0%BE%D0%B5%D0%BA%D1%82\" style=\"text-decoration: none; color: rgb(11, 0, 128); background-image: none; background-position: initial initial; background-repeat: initial initial;\" title=\"Проект\">проектов</a>,&nbsp;<a class=\"mw-redirect\" href=\"http://ru.wikipedia.org/wiki/%D0%9E%D1%86%D0%B5%D0%BD%D0%BA%D0%B0\" style=\"text-decoration: none; color: rgb(11, 0, 128); background-image: none; background-position: initial initial; background-repeat: initial initial;\" title=\"Оценка\">оценки</a>&nbsp;<a class=\"new\" href=\"http://ru.wikipedia.org/w/index.php?title=%D0%9F%D1%80%D0%BE%D0%B3%D1%80%D0%B0%D0%BC%D0%BC%D0%B0_(%D0%BA%D0%BE%D0%BD%D1%86%D0%B5%D0%BF%D1%86%D0%B8%D1%8F)&amp;action=edit&amp;redlink=1\" style=\"text-decoration: none; color: rgb(165, 88, 88); background-image: none; background-position: initial initial; background-repeat: initial initial;\" title=\"Программа (концепция) (страница отсутствует)\">программ</a>&nbsp;или выработки&nbsp;<a href=\"http://ru.wikipedia.org/wiki/%D0%9F%D0%BE%D0%BB%D0%B8%D1%82%D0%B8%D0%BA%D0%B0\" style=\"text-decoration: none; color: rgb(11, 0, 128); background-image: none; background-position: initial initial; background-repeat: initial initial;\" title=\"Политика\">политики</a>. Он несёт одну или более из трёх организационных функций:</p>\n\n<ul style=\"line-height: 19.1875px; margin: 0.3em 0px 0px 1.6em; padding-right: 0px; padding-left: 0px; list-style-image: url(data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAUAAAANAQMAAABb8jbLAAAABlBMVEX///8AUow5QSOjAAAAAXRSTlMAQObYZgAAABNJREFUCB1jYEABBQw/wLCAgQEAGpIDyT0IVcsAAAAASUVORK5CYII=); color: rgb(0, 0, 0); font-family: sans-serif;\">\n	<li style=\"margin-bottom: 0.1em;\">выявляет состояние критических или находящихся в состоянии изменения явлений окружающей среды, в отношении которых будет выработан курс действий на будущее;</li>\n	<li style=\"margin-bottom: 0.1em;\">устанавливает отношения со своим окружением, обеспечивая обратную связь, в отношении предыдущих&nbsp;<a href=\"http://ru.wikipedia.org/wiki/%D0%A3%D0%B4%D0%B0%D1%87%D0%B0\" style=\"text-decoration: none; color: rgb(11, 0, 128); background-image: none; background-position: initial initial; background-repeat: initial initial;\" title=\"Удача\">удач</a>&nbsp;и неудач определенной политики или программ;</li>\n	<li style=\"margin-bottom: 0.1em;\">устанавливает соответствия правилам и контрактным обязательствам.</li>\n	<li style=\"margin-bottom: 0.1em;\"><b style=\"color: rgb(0, 0, 0); font-family: sans-serif; line-height: 19.1875px;\">Мониторинг параметров</b><span style=\"color: rgb(0, 0, 0); font-family: sans-serif; line-height: 19.1875px;\">&nbsp;&mdash; наблюдение за какими либо параметрами. Результат мониторинга параметров представляет собой совокупность измеренных значений параметров, получаемых на неразрывно примыкающих друг к другу интервалах времени, в течение которых значения параметров существенно не изменяются.</span></li>\n</ul>','2013-05-13 21:56:00','2013-05-09 12:13:00',0,0,'left','2013-05-05 00:00:00',0,''),
	(34,6,'Авторский надзор','Общая статья об авторском надзоре','<p style=\"color: rgb(0, 0, 0); font-family: verdana; text-align: justify;\"><b style=\"line-height: 19.1875px; color: rgb(0, 0, 0); font-family: sans-serif;\">А́вторский надзо́р</b><span style=\"line-height: 19.1875px; color: rgb(0, 0, 0); font-family: sans-serif;\">&nbsp;&mdash; контроль лица, осуществившего подготовку проектной&nbsp;</span><a href=\"http://ru.wikipedia.org/wiki/%D0%94%D0%BE%D0%BA%D1%83%D0%BC%D0%B5%D0%BD%D1%82%D0%B0%D1%86%D0%B8%D1%8F\" style=\"line-height: 19.1875px; text-decoration: none; color: rgb(11, 0, 128); background-image: none; font-family: sans-serif;\" title=\"Документация\">документации</a><span style=\"line-height: 19.1875px; color: rgb(0, 0, 0); font-family: sans-serif;\">, за соблюдением в процессе строительства требований проектной документации</span><span style=\"color: rgb(0, 0, 0); font-family: sans-serif; font-size: 11px; line-height: 10.828125px;\">.</span></p>\n\n<p style=\"color: rgb(0, 0, 0); font-family: verdana; text-align: justify;\">&nbsp;</p>\n\n<p style=\"margin: 0.4em 0px 0.5em; line-height: 19.1875px; color: rgb(0, 0, 0); font-family: sans-serif;\">Авторский надзор представляет собой совокупность действий, осуществляемых визуально и документально и направленных на определение соответствия&nbsp;<a href=\"http://ru.wikipedia.org/wiki/%D0%93%D1%80%D0%B0%D0%B4%D0%BE%D1%81%D1%82%D1%80%D0%BE%D0%B8%D1%82%D0%B5%D0%BB%D1%8C%D1%81%D1%82%D0%B2%D0%BE\" style=\"text-decoration: none; color: rgb(11, 0, 128); background-image: none; background-position: initial initial; background-repeat: initial initial;\" title=\"Градостроительство\">градостроительных</a>,&nbsp;<a href=\"http://ru.wikipedia.org/wiki/%D0%90%D1%80%D1%85%D0%B8%D1%82%D0%B5%D0%BA%D1%82%D1%83%D1%80%D0%B0\" style=\"text-decoration: none; color: rgb(11, 0, 128); background-image: none; background-position: initial initial; background-repeat: initial initial;\" title=\"Архитектура\">архитектурно</a>-планировочных, художественных, технических, технологических и природоохранных решений и действий, осуществляемых&nbsp;<a class=\"mw-redirect\" href=\"http://ru.wikipedia.org/wiki/%D0%9F%D0%BE%D0%B4%D1%80%D1%8F%D0%B4%D1%87%D0%B8%D0%BA\" style=\"text-decoration: none; color: rgb(11, 0, 128); background-image: none; background-position: initial initial; background-repeat: initial initial;\" title=\"Подрядчик\">подрядчиком</a>&nbsp;в процессе возведения объекта строительства, принятым решениям в рабочем проекте объекта строительства и зафиксированным в документации.</p>\n\n<p style=\"margin: 0.4em 0px 0.5em; line-height: 19.1875px; color: rgb(0, 0, 0); font-family: sans-serif;\">Основывается на закрепленном в&nbsp;<a href=\"http://ru.wikipedia.org/wiki/%D0%93%D1%80%D0%B0%D0%B6%D0%B4%D0%B0%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D0%BA%D0%BE%D0%B4%D0%B5%D0%BA%D1%81_%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B9%D1%81%D0%BA%D0%BE%D0%B9_%D0%A4%D0%B5%D0%B4%D0%B5%D1%80%D0%B0%D1%86%D0%B8%D0%B8\" style=\"text-decoration: none; color: rgb(11, 0, 128); background-image: none; background-position: initial initial; background-repeat: initial initial;\" title=\"Гражданский кодекс Российской Федерации\">Гражданском кодексе РФ</a>&nbsp;праве&nbsp;<a href=\"http://ru.wikipedia.org/wiki/%D0%90%D0%B2%D1%82%D0%BE%D1%80\" style=\"text-decoration: none; color: rgb(11, 0, 128); background-image: none; background-position: initial initial; background-repeat: initial initial;\" title=\"Автор\">автора</a>&nbsp;произведения архитектуры, градостроительства или садово-паркового искусства на осуществление авторского надзора за строительством здания или сооружения либо иной реализацией соответствующего&nbsp;<a href=\"http://ru.wikipedia.org/wiki/%D0%9F%D1%80%D0%BE%D0%B5%D0%BA%D1%82\" style=\"text-decoration: none; color: rgb(11, 0, 128); background-image: none; background-position: initial initial; background-repeat: initial initial;\" title=\"Проект\">проекта</a>.</p>\n\n<p style=\"margin: 0.4em 0px 0.5em; color: rgb(0, 0, 0); font-family: sans-serif;\"><span style=\"line-height: 19.1875px;\">Кроме того,&nbsp;<a href=\"http://ru.wikipedia.org/wiki/%D0%90%D0%B2%D1%82%D0%BE%D1%80\" style=\"text-decoration: none; color: rgb(11, 0, 128); background-image: none; background-position: initial initial; background-repeat: initial initial;\" title=\"Автор\">автор</a>&nbsp;произведения архитектуры, градостроительства или садово-паркового искусства вправе требовать от заказчика соответствующего проекта предоставления права на участие в реализации своего проекта, если&nbsp;<a href=\"http://ru.wikipedia.org/wiki/%D0%94%D0%BE%D0%B3%D0%BE%D0%B2%D0%BE%D1%80\" style=\"text-decoration: none; color: rgb(11, 0, 128); background-image: none; background-position: initial initial; background-repeat: initial initial;\" title=\"Договор\">договором</a>&nbsp;не предусмотрено иное</span><span style=\"font-size: 11px; line-height: 10.828125px;\">.</span></p>\n\n<p style=\"margin: 0.4em 0px 0.5em; color: rgb(0, 0, 0); font-family: sans-serif;\"><span style=\"line-height: 19.1875px;\">В соответствии с п. 7.6&nbsp;<a href=\"http://ru.wikipedia.org/wiki/%D0%A1%D0%B2%D0%BE%D0%B4_%D0%BF%D1%80%D0%B0%D0%B2%D0%B8%D0%BB_(%D1%82%D0%B5%D1%85%D0%BD%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%BE%D0%B5_%D1%80%D0%B5%D0%B3%D1%83%D0%BB%D0%B8%D1%80%D0%BE%D0%B2%D0%B0%D0%BD%D0%B8%D0%B5)\" style=\"text-decoration: none; color: rgb(11, 0, 128); background-image: none; background-position: initial initial; background-repeat: initial initial;\" title=\"Свод правил (техническое регулирование)\">свода правил</a>&nbsp;СП 48.13330.2011 &laquo;Организация строительства. Актуализированная редакция СНиП 12-01-2004&raquo;, утверждённого Приказом&nbsp;<a href=\"http://ru.wikipedia.org/wiki/%D0%9C%D0%B8%D0%BD%D0%B8%D1%81%D1%82%D0%B5%D1%80%D1%81%D1%82%D0%B2%D0%BE_%D1%80%D0%B5%D0%B3%D0%B8%D0%BE%D0%BD%D0%B0%D0%BB%D1%8C%D0%BD%D0%BE%D0%B3%D0%BE_%D1%80%D0%B0%D0%B7%D0%B2%D0%B8%D1%82%D0%B8%D1%8F_%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B9%D1%81%D0%BA%D0%BE%D0%B9_%D0%A4%D0%B5%D0%B4%D0%B5%D1%80%D0%B0%D1%86%D0%B8%D0%B8\" style=\"text-decoration: none; color: rgb(11, 0, 128); background-image: none; background-position: initial initial; background-repeat: initial initial;\" title=\"Министерство регионального развития Российской Федерации\">Минрегиона России</a>&nbsp;от 27 декабря 2010 г. № 781, авторский надзор&nbsp;<a href=\"http://ru.wikipedia.org/wiki/%D0%90%D1%80%D1%85%D0%B8%D1%82%D0%B5%D0%BA%D1%82%D0%BE%D1%80\" style=\"text-decoration: none; color: rgb(11, 0, 128); background-image: none; background-position: initial initial; background-repeat: initial initial;\" title=\"Архитектор\">архитектора</a>&nbsp;осуществляется автором-архитектором в инициативном порядке независимо от решения застройщика (заказчика) и наличия договора на авторский надзор по объекту. Территориальный орган по архитектуре и градостроительству по заявлению автора, удостоверившись в его авторстве, может выдать застройщику (заказчику) распоряжение об обеспечении допуска автора на объект строительства, возможности внесения им записей в журнал авторского надзора. Претензии автора-архитектора по реализации архитектурных проектных решений могут рассматриваться органом по градостроительству и архитектуре, решение которого является обязательным для застройщика (заказчика)</span><span style=\"font-size: 11px; line-height: 10.828125px;\">.</span></p>','2013-05-13 21:57:00','2013-05-09 12:13:00',0,0,'left','2013-05-05 00:00:00',0,''),
	(42,8,'Новый партнер компании','Новый партнер компании - Simons-Voss','<p>С радостью сообщаем о заключении партнерского договора с компанией&nbsp;<a href=\"http://www.simons-voss.com/?L=1\">Simons-Voss</a>.</p>\n\n<p>Компания&nbsp;Simons-Voss является мировым лидером в производстве оборудования для систем безопасности.</p>\n\n<p>Мы гордимся нашим партнером.</p>\n\n<p>&nbsp;</p>','2013-05-13 21:39:00','2013-05-09 21:50:00',0,0,'left','2013-05-05 00:00:00',0,''),
	(51,2,'Название проекта','В данном маленьком абзаце необходимо разместить текст-завлечение для пользователей, интересующихся данным видом проектов или самим проектом. Количество строк предположительно 3-4.','<p><span style=\"color: rgb(0, 0, 0); font-family: verdana; line-height: normal; text-align: justify;\">Текстовый блок с описанием проекта</span></p>','2013-05-11 11:54:00','2013-05-11 11:54:00',0,0,'left','2013-05-11 11:53:00',1,'pr_X_001_001'),
	(52,3,'Тендер','Тендер компании','<p>1234</p>','2013-05-13 22:04:00','2013-05-13 22:04:00',0,0,'left','2013-05-13 22:04:00',0,'');
