INSERT INTO `text_item` (`id`, `parent_id`, `title`, `description`, `show_title`, `date_updated`, `date_created`)
VALUES
	(1,4,'контакты','<p><span style=\"font-size:24px;\"><strong>МЫ НАХОДИМСЯ<br />\nПО АДРЕСУ:</strong></span><br />\nРоссия, Москва,<br />\nКутузовский проспект,&nbsp;<span style=\"line-height: 1.6em;\">д.36, стр. 23</span><br />\n<br />\n&nbsp;</p>\n\n<p><span style=\"line-height: 1.6em;\"><strong><span style=\"font-size:24px;\">СВЯЖИТЕСЬ С НАМИ</span></strong></span></p>\n\n<p><span style=\"color:#696969;\"><strong><span style=\"line-height: 1.6em;\">ПО ТЕЛЕФОНУ:</span></strong></span></p>\n\n<p><strong><span style=\"font-family:trebuchet ms,helvetica,sans-serif;\"><span style=\"font-size:24px;\"><a href=\"tel:%2b74956004580\" style=\"line-height: 1.6em;\">+7 (495) 600 45 80</a></span></span></strong></p>\n\n<p><span style=\"color:#696969;\"><strong><font face=\"trebuchet ms, helvetica, sans-serif\">ИЛИ ПО ЭЛЕКТРОННОЙ ПОЧТЕ:</font></strong></span></p>\n\n<p><strong><span style=\"font-size:24px;\"><a href=\"mailto:Info@utc-Russia.ru?subject=%D0%92%D0%BE%D0%BF%D1%80%D0%BE%D1%81\" span=\"\" sttyle=\"font-family:trebuchet ms,helvetica,sans-serif;\">Info@utc-Russia.ru</a></span></strong></p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>',0,'2013-05-08 13:28:00','2013-05-04 10:11:00'),
	(2,5,'Немного о нас','<h2 style=\"margin: 0cm 0cm 0.0001pt;\"><span style=\"font-family: \'trebuchet ms\', helvetica, sans-serif; font-size: 24px; line-height: 1.2em;\">Инжиниринговая компания ОТК &ndash; новое слово на российском рынке инжиниринговых и&nbsp;проектировочных услуг, динамично развивающаяся команда профессионалов, рабочая&nbsp;деятельность которых базируется на инновационном подходе к решению задач.&nbsp;</span></h2>\n\n<h2 style=\"margin: 0cm 0cm 0.0001pt;\"><strong><span style=\"color:#333132\">&nbsp;</span></strong></h2>\n\n<p style=\"margin:0cm;margin-bottom:.0001pt\"><span style=\"color:#333132\">Современная технологическая база, комплексное обеспечение реализации проектов, клиентоориентированная политика компании &ndash; гарантийная база, позволяющая нашей команде высококачественно выполнять&nbsp; работы любого уровня сложности.<o:p></o:p></span></p>\n\n<p style=\"margin:0cm;margin-bottom:.0001pt\"><span style=\"color:#333132\">&nbsp;<o:p></o:p></span></p>\n\n<p style=\"margin:0cm;margin-bottom:.0001pt\"><span style=\"color:#333132\">С момента создания и по сегодняшний день компания ОТК ставит своей задачей постоянное развитие, гармонично развивая все отдельные сегменты своих услуг, для того, чтобы клиенты и партнеры компании получали самые полные предложения и максимальную техническую базу для реализации любых проектов &ndash; от бизнес-идеи до сдачи объекта и его дальнейшей эксплуатации.&nbsp;</span></p>\n\n<p style=\"margin:0cm;margin-bottom:.0001pt\">&nbsp;</p>\n\n<p style=\"margin:0cm;margin-bottom:.0001pt\"><b><span style=\"color:#333132\">Миссия<br />\n&nbsp;<o:p></o:p></span></b></p>\n\n<p style=\"margin:0cm;margin-bottom:.0001pt\"><span style=\"color:#333132\">Мы работаем для построения эффективного бизнеса своих клиентов; мы строим долгосрочные дружественные отношения не только с клиентами и партнерами компании, но и с каждым участником рынка;<o:p></o:p></span></p>\n\n<p style=\"margin:0cm;margin-bottom:.0001pt\"><span style=\"color:#333132\">&nbsp;</span></p>\n\n<p style=\"margin:0cm;margin-bottom:.0001pt\"><span style=\"color:#333132\">Мы постоянно совершенствуем технологическую базу и базу своих знаний для того, чтобы занимать на рынке лидирующие позиции; <o:p></o:p></span></p>\n\n<p style=\"margin:0cm;margin-bottom:.0001pt\"><span style=\"color:#333132\">&nbsp;</span></p>\n\n<p style=\"margin:0cm;margin-bottom:.0001pt\"><span style=\"color:#333132\">Мы&nbsp; поддерживаем экологические программы и следим за тем, чтобы максимально бережно взаимодействовать с окружающей средой. <o:p></o:p></span></p>\n\n<p style=\"margin:0cm;margin-bottom:.0001pt\"><span style=\"color:#333132\">&nbsp;<o:p></o:p></span></p>\n\n<p style=\"margin:0cm;margin-bottom:.0001pt\"><span style=\"color:#333132\">Система ценностей нашей компании прозрачна и актуальна: уверенный результат, инновационный подход во всем, командная работа, ответственность, эффективность.&nbsp;<o:p></o:p></span></p>\n\n<p style=\"margin:0cm;margin-bottom:.0001pt\"><span style=\"color:#333132\"><o:p></o:p></span></p>',1,'2013-05-10 12:06:00','2013-05-04 11:39:00'),
	(4,8,'Проектирование','<p>Проектирование &ndash; ОТК</p>\n\n<p>Проектный отдел компании ОТК готов оказать услуги по составлению технических заданий, проектированию и технико-экономических обоснований любой степени сложности. По запросу заказчика проектный отдел так же готов предоставить разработку проекта &laquo;с нуля&raquo; и полный портфель рабочей документации, а так же провести все этапы согласований проектных решений в инспектирующих органах, обеспечить авторский контроль на объектах.</p>\n\n<p><strong>Наша цель:</strong>&nbsp;<br />\n<em>долгосрочная и качественная работа всех инженерных систем проекта<br />\nи систем жизнедеятельности.</em></p>\n\n<p>Все проектные работы осуществляются&nbsp; в строгом соответствии с условиями безопасности, с применением инновационных технологий и материалов, а так же в сопровождении всего комплекса нормативной документации.</p>\n\n<p><strong>Проектные работы:</strong></p>\n\n<ul>\n	<li>Системы вентиляции и кондиционирования помещений жилой и коммерческой недвижимости;</li>\n	<li>Системы отопления, водоснабжения и канализации;</li>\n	<li>Системы энергоснабжения;</li>\n	<li>Системы освещения (рабочее освещение; аварийное освещение (освещение безопасности и эвакуационное); охранное освещение; дежурное освещение; наружное освещение);</li>\n	<li>Проектирование автоматизации;</li>\n	<li>Системы сигнализации и связи (cлаботочные системы - радиофикация, телефонизация, телевидение; системы безопасности - охранная сигнализация, контроль доступа, оповещение, видеонаблюдение, система передачи данных);</li>\n	<li>Системы противопожарной защиты (устранение причин, которые могут вызвать возникновение пожаров; ограничение распространения возможных пожаров и создание условий для успешной эвакуации людей и имущества в случае пожара; обеспечение своевременного обнаружения возникшего пожара, быстрого вызова пожарной охраны и успешного тушения пожара)</li>\n	<li>Реконструкции уже существующих инженерных систем, повышение эффективности их работы;</li>\n	<li>Архитектурные решения фасадных и внутренних планировок, план с системами наружных конструкций (водопровод, канализация, очистные сооружения, водопроводные и электростанции, тепло-газо-электроснабжение).&nbsp;</li>\n</ul>\n\n<p>&nbsp;</p>',0,'2013-05-15 20:30:00','2013-05-04 12:13:00'),
	(5,3,'Услуги (текстовка)','<p class=\"p1\"><span style=\"font-size:22px;\"><b>Проектно-изыскательские работы</b></span></p>\n\n<p class=\"p2\">Проектное бюро компании ОТК &nbsp;оказывает услуги по составлению технических заданий, разработке проектной документации и технико-экономических обоснований, а так же провести все этапы согласований проектных решений в инспектирующих органах, обеспечить авторский надзор на объектах.</p>\n\n<p class=\"p3\"><span style=\"font-size:22px;\"><b>Наша цель:</b></span></p>\n\n<p class=\"p4\"><i>Профессиональный подход, создание решений любой степени сложности.</i></p>\n\n<p class=\"p5\">Все проектные работы осуществляются&nbsp; в строгом соответствии с нормативно-технической базой действующей на территории РФ, условиями безопасности, с применением инновационных технологий и материалов, а так же в сопровождении всего комплекса нормативной документации.</p>\n\n<p style=\"margin-left: 36pt;\">&nbsp;</p>\n\n<p style=\"margin:0cm;margin-bottom:.0001pt\"><span style=\"color:#333132\"><o:p></o:p></span></p>',0,'2013-05-15 22:56:00','2013-05-04 12:35:00'),
	(6,9,'КОПИЯ-КОПИЯ','<h2 style=\"margin: 0cm 0cm 0.0001pt;\">&nbsp;</h2>\n\n<h2 style=\"margin: 0cm 0cm 0.0001pt;\"><span style=\"font-size:18px;\"><strong><span style=\"font-family:trebuchet ms,helvetica,sans-serif;\"><span style=\"color: rgb(51, 49, 50);\">Инжиниринговая компания ОТК &ndash; новое слово на российском рынке инжиниринговых и&nbsp;проектировочных услуг, динамично развивающаяся команда профессионалов, рабочая&nbsp;деятельность которых базируется на инновационном подходе к решению задач. </span></span></strong></span><span style=\"font-size: 12pt; color: rgb(51, 49, 50);\"><o:p></o:p></span></h2>\n\n<h2 style=\"margin: 0cm 0cm 0.0001pt;\"><strong><span style=\"color:#333132\">&nbsp;</span></strong></h2>\n\n<p style=\"margin:0cm;margin-bottom:.0001pt\"><span style=\"color:#333132\">Современная технологическая база, комплексное обеспечение реализации проектов, клиентоориентированная политика компании &ndash; гарантийная база, позволяющая нашей команде высококачественно выполнять&nbsp; работы любого уровня сложности.<o:p></o:p></span></p>\n\n<p style=\"margin:0cm;margin-bottom:.0001pt\"><span style=\"color:#333132\">&nbsp;<o:p></o:p></span></p>\n\n<p style=\"margin:0cm;margin-bottom:.0001pt\"><span style=\"color:#333132\">С момента создания и по сегодняшний день компания ОТК ставит своей задачей постоянное развитие, гармонично развивая все отдельные сегменты своих услуг, для того, чтобы клиенты и партнеры компании получали самые полные предложения и максимальную техническую базу для реализации любых проектов &ndash; от бизнес-идеи до сдачи объекта и его дальнейшей эксплуатации.&nbsp;</span></p>\n\n<p style=\"margin:0cm;margin-bottom:.0001pt\">&nbsp;</p>\n\n<p style=\"margin:0cm;margin-bottom:.0001pt\"><b><span style=\"color:#333132\">Миссия<br />\n&nbsp;<o:p></o:p></span></b></p>\n\n<p style=\"margin:0cm;margin-bottom:.0001pt\"><span style=\"color:#333132\">Мы работаем для построения эффективного бизнеса своих клиентов; мы строим долгосрочные дружественные отношения не только с клиентами и партнерами компании, но и с каждым участником рынка;<o:p></o:p></span></p>\n\n<p style=\"margin:0cm;margin-bottom:.0001pt\"><span style=\"color:#333132\">&nbsp;</span></p>\n\n<p style=\"margin:0cm;margin-bottom:.0001pt\"><span style=\"color:#333132\">Мы постоянно совершенствуем технологическую базу и базу своих знаний для того, чтобы занимать на рынке лидирующие позиции; <o:p></o:p></span></p>\n\n<p style=\"margin:0cm;margin-bottom:.0001pt\"><span style=\"color:#333132\">&nbsp;</span></p>\n\n<p style=\"margin:0cm;margin-bottom:.0001pt\"><span style=\"color:#333132\">Мы&nbsp; поддерживаем экологические программы и следим за тем, чтобы максимально бережно взаимодействовать с окружающей средой. <o:p></o:p></span></p>\n\n<p style=\"margin:0cm;margin-bottom:.0001pt\"><span style=\"color:#333132\">&nbsp;<o:p></o:p></span></p>\n\n<p style=\"margin:0cm;margin-bottom:.0001pt\"><span style=\"color:#333132\">Система ценностей нашей компании прозрачна и актуальна: уверенный результат, инновационный подход во всем, командная работа, ответственность, эффективность.&nbsp;<o:p></o:p></span></p>\n\n<p style=\"margin:0cm;margin-bottom:.0001pt\"><span style=\"color:#333132\"><o:p></o:p></span></p>',1,'2013-05-04 12:51:00','2013-05-04 12:49:00'),
	(7,13,'Авторский надзор','<p><span style=\"line-height: 1.6em;\">Компания ОТК &nbsp;не&nbsp;только полностью несет ответственность за обеспечение качества всех работ по проекту, но так же исполняет функции надзирающего органа, подключая свой аналитический отдел к работе над оперативным выявлением и устранением факторов, которые могут стать потенциально опасными для эксплуатационных характеристик объектов и систем, привести к снижению эффективности и надежности объектов.</span></p>\n\n<p>Осуществление авторского надзора&nbsp; специалистами нашей компании помогает клиентам и партнерам оперативно определять направления,&nbsp; требующие особого внимания; &nbsp;а так же работать на опережение, предварительно учитывая все возможные риски предприятия, связанные с наличием научно-технической и&nbsp;разрешительной документации, отклонениями от&nbsp;проектных решений и планов финансирования объектов.</p>\n\n<ul>\n	<li>Проведение аудита здания;</li>\n	<li>Разработка индивидуального регламента;</li>\n	<li>Восстановление/модернизация</li>\n	<li>Мониторинг в режиме 24/7</li>\n	<li>Снижение издержек</li>\n	<li>Повышение уровня безопасности</li>\n	<li>Паспортизация</li>\n	<li>Эффективная эксплуатация</li>\n</ul>\n\n<p>В соответствии с индивидуальными особенностями каждого предприятия и проекта, группы авторского надзора компании ОТК осуществляют выезды на поднадзорные объекты, а так же полевые офисы наблюдения за исполнением работ и задач; проводят комплексные работы по отчетности и анализу текущих и будущих ситуаций, а так же пул рекомендательных бумаг.&nbsp;</p>',1,'2013-05-10 16:49:00','2013-05-04 22:56:00'),
	(8,14,'Мониторинг 24/7','<p><span style=\"line-height: 1.6em;\">Создание собственной системы мониторинга&nbsp; (диспетчеризации) систем жизнедеятельности здания коммерческой, промышленной или жилой недвижимости &ndash; залог полного контроля состояния всех инженерных сетей, коммуникаций и систем, а так же залог их безопасного и эффективного функционирования.</span></p>\n\n<p>Контроль над объектом позволяет собственнику и эксплуатирующей компании предупреждать вовремя все возникающие сложности, возникновение чрезвычайных ситуаций. Так же качественная система мониторинга позволяет существенно снизить финансовые затраты на устранение последствий неполадок в&nbsp; системе инженерных сетей и коммуникаций.</p>\n\n<p><span style=\"line-height: 1.6em;\">Входящая в состав автоматизации и диспетчеризации информационная система мониторинга предназначена для интеграции данных, поступающих от инженерных систем здания, контроля возникновения дестабилизирующих факторов, и передачи оперативной информации на круглосуточный центральный диспетчерский пункт для последующей передачи в&nbsp; круглосуточные аварийные бригады.&nbsp;</span></p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>',1,'2013-05-11 11:32:00','2013-05-04 23:00:00'),
	(9,15,'строительный контроль','<p><span style=\"line-height: 1.6em;\">Полный контроль и технико-экономический надзор за объектом жилой, производственной или коммерческой недвижимости на стадии строительства &ndash; основа будущего успешного функционирования и высокой прибыльности объекта.</span></p>\n\n<p><span style=\"line-height: 1.6em;\">Наша основная рекомендация &ndash; как можно более ранее привлечение специалистов по строительному контролю, так как это позволяет достичь гораздо более существенной экономии и разумного распределения средств из бюджета проекта, а так же избежать исправления возможных дефектов на стадии эксплуатации, что влечет за собой финансовые потери.</span></p>\n\n<p><strong style=\"line-height: 1.6em;\"><em>Стоимость строительного контроля рассчитывается индивидуально в&nbsp;зависимости от&nbsp;характеристик объекта.</em></strong></p>\n\n<ul>\n	<li>Проверка соответствия объекта техническим регламентам</li>\n	<li>Проверка соответствия технико-технологической и разрешительной документации</li>\n	<li>Контроль качества строительных и монтажных&nbsp; работ</li>\n	<li>Контроль качества строительных материалов и конструкций, проверка сертифицирования</li>\n	<li>Контроль безопасности строительных работ, контроль безопасности объекта</li>\n	<li>Отчетная документация</li>\n	<li>Информационное сопровождение</li>\n</ul>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>',1,'2013-05-11 11:33:00','2013-05-04 23:01:00'),
	(10,20,'охрана окружающей среды','<p><span style=\"line-height: 1.6em;\">В качестве обеспечения надежности и целостности работ, а так же во избежание возможных затрат на дополнительные статьи расходов (экологическое и природоохранное наблюдение), мы предлагаем клиентам и партнерам воспользоваться услугами по проведению инженерных изысканий &ndash; как в городских проектах, так и в полевых условиях.</span></p>\n\n<p>Сохранение экологической безопасности &ndash; ключевая задача каждой компании, которая делает надежность, эффективность и инновационный подход во всем своей основной целью.</p>\n\n<ul>\n	<li>Комплексное изучение экологических и техногенных условий каждого объекта;</li>\n	<li>Комплекс работ по составлению проектных инжиниринговых решений;</li>\n	<li>Надзор за соблюдением всех нормативных актов, принятых в рамках Законодательства РФ по соблюдению баланса природной среды;</li>\n	<li>Разработка комплексного проекта в области охраны окружающей среды, разработка пакета сопроводительно-разрешительной документации.&nbsp;</li>\n</ul>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>',0,'2013-05-11 11:34:00','2013-05-04 23:04:00'),
	(11,19,'Авторская система безопасности','<p><span style=\"line-height: 1.6em;\">Разработка комплекса мероприятий по предотвращению и минимизации факторов возникновения угроз:</span></p>\n\n<ul>\n	<li>Террористического;</li>\n	<li>Техногенного;</li>\n	<li>Криминального;</li>\n	<li>Коммунально-бытового и жилищного характера;&nbsp;</li>\n	<li>В сфере транспорта;&nbsp;</li>\n</ul>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>',0,'2013-05-11 11:34:00','2013-05-04 23:06:00'),
	(12,18,'Монтажные работы','<p><span style=\"line-height: 1.6em;\">Компания ОТК осуществляет весь комплекс услуг по монтажу инженерных систем и сетей. Специалисты компании применяют&nbsp; к каждому проекту индивидуальный подход, что позволяет решать самые нестандартные задачи с учетом всех особенностей каждого помещения или объекта.</span></p>\n\n<ul>\n	<li>Монтаж систем вентиляции и кондиционирования помещений (как локальных помещений, так и комплексных проектов многоэтажных зданий);</li>\n	<li>Монтаж систем водоснабжения, канализации;</li>\n	<li>Монтаж систем холодоснабжения и теплоснабжения;</li>\n	<li>Монтаж систем энергоснабжения и автоматизации;</li>\n	<li>Капитальный ремонт и реконструкция существующих внутренних систем коммерческой, промышленной&nbsp; и жилой недвижимости на базе инженерного переосмысления концепции эффективности и производительности существующих систем.&nbsp;</li>\n</ul>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>',1,'2013-05-11 11:33:00','2013-05-04 23:08:00'),
	(15,12,'Хотите стать нашим клиентом?','<p style=\"color: rgb(0, 0, 0); font-family: verdana; line-height: normal; text-align: justify;\">В данном блоке вы можете узнать как стать партнерами нашей компании.</p>\n\n<p style=\"color: rgb(0, 0, 0); font-family: verdana; line-height: normal; text-align: justify;\">Читайте подробную информацию в данном разделе</p>\n\n<p style=\"color: rgb(0, 0, 0); font-family: verdana; line-height: normal; text-align: justify;\">&nbsp;</p>\n\n<p style=\"color: rgb(0, 0, 0); font-family: verdana; line-height: normal; text-align: justify;\">&nbsp;</p>\n\n<p style=\"color: rgb(0, 0, 0); font-family: verdana; line-height: normal; text-align: justify;\">&nbsp;</p>\n\n<p style=\"color: rgb(0, 0, 0); font-family: verdana; line-height: normal; text-align: justify;\">&nbsp;</p>\n\n<p style=\"color: rgb(0, 0, 0); font-family: verdana; line-height: normal; text-align: justify;\">&nbsp;</p>\n\n<p style=\"color: rgb(0, 0, 0); font-family: verdana; line-height: normal; text-align: justify;\">&nbsp;</p>\n\n<p style=\"color: rgb(0, 0, 0); font-family: verdana; line-height: normal; text-align: justify;\">&nbsp;</p>\n\n<p style=\"color: rgb(0, 0, 0); font-family: verdana; line-height: normal; text-align: justify;\">&nbsp;</p>\n\n<p style=\"color: rgb(0, 0, 0); font-family: verdana; line-height: normal; text-align: justify;\">&nbsp;</p>\n\n<p style=\"color: rgb(0, 0, 0); font-family: verdana; line-height: normal; text-align: justify;\">&nbsp;</p>\n\n<p style=\"color: rgb(0, 0, 0); font-family: verdana; line-height: normal; text-align: justify;\">&nbsp;</p>\n\n<p style=\"color: rgb(0, 0, 0); font-family: verdana; line-height: normal; text-align: justify;\">&nbsp;</p>\n\n<p style=\"color: rgb(0, 0, 0); font-family: verdana; line-height: normal; text-align: justify;\">&nbsp;</p>\n\n<p style=\"color: rgb(0, 0, 0); font-family: verdana; line-height: normal; text-align: justify;\">&nbsp;</p>\n\n<p style=\"color: rgb(0, 0, 0); font-family: verdana; line-height: 