	(16,10,'проекты','<p class=\"p1\"><span style=\"font-size:22px;\"><b>Проектно-изыскательские работы</b></span></p>\n\n<p class=\"p2\">Проектное бюро компании ОТК &nbsp;оказывает услуги по составлению технических заданий, разработке проектной документации и технико-экономических обоснований, а так же провести все этапы согласований проектных решений в инспектирующих органах, обеспечить авторский надзор на объектах.</p>\n\n<p class=\"p3\"><span style=\"font-size:22px;\"><b>Наша цель:</b></span></p>\n\n<p class=\"p4\"><i>Профессиональный подход, создание решений любой степени сложности.</i></p>\n\n<p class=\"p5\">Все проектные работы осуществляются&nbsp; в строгом соответствии с нормативно-технической базой действующей на территории РФ, условиями безопасности, с применением инновационных технологий и материалов, а так же в сопровождении всего комплекса нормативной документации.</p>\n\n<p class=\"p6\"><b>Проектные работы:</b></p>\n\n<p class=\"p7\"><span class=\"s1\">Раздел 2</span> &quot;Схема планировочной организации земельного участка&quot;</p>\n\n<p class=\"p7\"><span class=\"s1\">Раздел 3</span> &quot;Архитектурные решения&quot;</p>\n\n<p class=\"p7\"><span class=\"s1\">Раздел 4</span> &quot;Конструктивные и объёмно-планировочные решения&quot;</p>\n\n<p class=\"p7\"><span class=\"s1\">Раздел 5</span> &quot;Сведения об инженерном оборудовании, о сетях инженерно-технического обеспечения, перечень инженерно-технических мероприятий, содержание технологических решений&quot; должен состоять из следующих подразделов:</p>\n\n<ul>\n	<li class=\"p7\">&nbsp;&nbsp;&nbsp;&nbsp;а) подраздел &quot;Система электроснабжения&quot;; &nbsp;</li>\n	<li class=\"p7\">&nbsp;&nbsp;&nbsp;&nbsp;б) подраздел &quot;Система водоснабжения&quot;;</li>\n	<li class=\"p7\">&nbsp;&nbsp;&nbsp;&nbsp;в) подраздел &quot;Система водоотведения&quot;;</li>\n	<li class=\"p7\">&nbsp;&nbsp;&nbsp;&nbsp;г) подраздел &quot;Отопление, вентиляция и кондиционирование воздуха, &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;тепловые сети&quot;;</li>\n	<li class=\"p7\">&nbsp;&nbsp;&nbsp;&nbsp;д) подраздел &quot;Сети связи&quot;; &nbsp;</li>\n	<li class=\"p7\">&nbsp;&nbsp;&nbsp;&nbsp;е) подраздел &quot;Система газоснабжения&quot;;</li>\n	<li class=\"p7\">&nbsp;&nbsp;&nbsp;&nbsp;ж) подраздел &quot;Технологические решения&quot;.</li>\n</ul>\n\n<p class=\"p7\"><span class=\"s1\">Раздел 9</span> &quot;Мероприятия по обеспечению пожарной безопасности&quot;</p>\n\n<p class=\"p7\"><span class=\"s1\">Раздел 10</span> &quot;Мероприятия по обеспечению доступа инвалидов&quot;</p>\n\n<p class=\"p7\"><span class=\"s1\">Раздел 11</span> &quot;Смета на строительство объектов капитального строительства&quot;</p>\n\n<p class=\"p7\"><span class=\"s1\">Раздел 12</span> &quot;Иная документация в случаях, предусмотренных федеральными законами&quot;</p>\n\n<ul>\n	<li class=\"p7\"><span style=\"line-height: 1.6em;\">перечень мероприятий по гражданской обороне, мероприятий по предупреждению чрезвычайных ситуаций природного и техногенного характера для объектов использования атомной энергии (в том числе, опасных производственных объектов, определяемых таковыми в соответствии с законодательством Российской Федерации, особо опасных, технически сложных, уникальных объектов, объектов обороны и безопасности;);&nbsp;</span></li>\n	<li class=\"p7\">иную документацию, установленную законодательными актами Российской Федерации. (разделы СМИС/СМИК)</li>\n</ul>',1,'2013-05-15 20:35:00','2013-05-08 12:54:00'),
	(17,22,'вакансии','<p><b style=\"font-size: 24px; color: rgb(105, 105, 105); line-height: 1.6em;\">Кадровая политика</b></p>\n\n<p style=\"margin:0cm;margin-bottom:.0001pt\"><span style=\"color:#333132\">&nbsp;</span></p>\n\n<p style=\"margin:0cm;margin-bottom:.0001pt\"><span style=\"color:#333132\">Наша команда &ndash; команда профессионалов-единомышленников, мы ориентированы не только на развитие технической мощи компании, но и на постоянное развитие и совершенствование каждого сотрудника &ndash; наиболее полно реализованный в бизнесе профессионал&nbsp; неустанно способствует развитию компании. <o:p></o:p></span></p>\n\n<p style=\"margin:0cm;margin-bottom:.0001pt\"><span style=\"color:#333132\">&nbsp;</span></p>\n\n<p style=\"margin:0cm;margin-bottom:.0001pt\"><span style=\"color:#333132\">90% кадров ОТК прошли успешное обучение внутри компании, предполагающее дальнейшее совместное развитие и вертикальную ротацию собственных сотрудников.&nbsp;</span></p>\n\n<p style=\"margin:0cm;margin-bottom:.0001pt\">&nbsp;</p>\n\n<p style=\"margin:0cm;margin-bottom:.0001pt\">&nbsp;</p>\n\n<p style=\"margin:0cm;margin-bottom:.0001pt\">&nbsp;</p>\n\n<p style=\"margin:0cm;margin-bottom:.0001pt\"><span style=\"color:#333132\"><o:p></o:p></span></p>\n\n<p style=\"margin:0cm;margin-bottom:.0001pt\">&nbsp;</p>\n\n<p style=\"margin:0cm;margin-bottom:.0001pt\">&nbsp;</p>\n\n<p style=\"margin:0cm;margin-bottom:.0001pt\">&nbsp;</p>\n\n<p style=\"margin:0cm;margin-bottom:.0001pt\">&nbsp;</p>\n\n<p style=\"margin:0cm;margin-bottom:.0001pt\">&nbsp;</p>\n\n<p style=\"margin:0cm;margin-bottom:.0001pt\">&nbsp;</p>\n\n<p style=\"margin:0cm;margin-bottom:.0001pt\">&nbsp;</p>\n\n<p style=\"margin:0cm;margin-bottom:.0001pt\">&nbsp;</p>\n\n<p style=\"margin:0cm;margin-bottom:.0001pt\">&nbsp;</p>\n\n<p style=\"margin:0cm;margin-bottom:.0001pt\">&nbsp;</p>\n\n<p style=\"margin:0cm;margin-bottom:.0001pt\">&nbsp;</p>\n\n<p style=\"margin:0cm;margin-bottom:.0001pt\">&nbsp;</p>\n\n<p style=\"margin:0cm;m